import React from 'react';
import { Grid } from "@material-ui/core";
const ProductList = ({ category, list }) => {
    const getProductList = (object) => {
        const products = ({
            id: object.id,
            title: object.title,
            subtitle: object.subtitle,
            avatarSrc: object.avatarSrc,
            imgSrc: object.imgSrc,
            description: object.description,
        })
        return (
            <div>
                <div>
                    id={products.id}<br></br>
                    title={products.title}<br></br>
                    subtitle={products.subtitle}<br></br>
                    avatarSrc={products.avatarSrc}<br></br>
                    imgSrc={products.imgSrc}<br></br>
                    description={products.description}<br></br>
                    <br></br>
                </div>
            </div>
        )
    }

    const cat = ({
        category: category,
    })
    console.log(list);
    //container에서 넘어온 객체를 표현해주는 곳

    return (
        <div>
            <h1>카테고리 : {category}</h1>
            {list.map((products) => getProductList(products))}
        </div>
    );
};

export default ProductList;
